import React, { Component } from 'react';
import './home.css'
import { NavLink } from 'react-router-dom';
class Home extends Component {
    render() {
        return (
            <main>
              <div className="main-inner">
                <div className="topics">
                    <h3>热门文章</h3>
                    <ul className="topic-list">
                        <li><NavLink to="/" exact>推荐</NavLink></li>
                        <li><NavLink to="/home/frontend"></NavLink>前端</li>
                        <li><NavLink to="/home/andriod"></NavLink>Andriod</li>
                        <li><NavLink></NavLink>后端</li>
                        <li><NavLink></NavLink>人工智能</li>
                        <li><NavLink></NavLink>IOS</li>
                        <li><NavLink></NavLink>工具资源</li>
                        <li><NavLink></NavLink>阅读</li>
                        <li><NavLink></NavLink>运维</li>
                    </ul>
                </div>
              </div>
            </main>
        );
    }
}

export default Home;
